INSERT INTO `event_config` VALUES (1,'Своя игра','{\"title\": \"Доброго времени суток, мы запустили ивент - Своя игра! Присоединяйся!\",\"description\": \"Своя игра - интеллектуальная викторина, в которой каждый может проверить свои знания и скорость реакции и сразиться с оппонентами. Правила игры очень просты: все вопросы в игре поделены по темам, и у каждого вопроса в теме есть своя стоимость. У каждого игрока имеется персональный счёт, который в начале игры равен 0. Звучит вопрос, после которого на экране появляется рамка, показывающая, что можно отвечать. Если игрок знает ответ, он может нажать на красную кнопку. Тот из игроков, кто нажмёт на кнопку ранее (и не допустит фальстарта), и даёт ответ. В случае верного ответа стоимость вопроса прибавляется к счёту игрока; в случае неверного — снимается со счёта. В последнем случае другие игроки снова могут попытать счастья и нажать на кнопку для ответа.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n• [Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080130224278220820)\\n**Награды:**\\n<:__:998250854610108517> **Победа** 200 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Своя игра\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\":\"https://media.discordapp.net/attachments/738118586677330013/1079863784388173894/gif001.gif\"}',30,12),(2,'Among Us ','{\"title\": \"Доброго времени суток, мы запустили ивент - Among Us! Присоединяйся!\",\"description\": \"Локальная и сетевая игра для компании от 4 до 15 игроков о командной работе и предательстве... в космосе! Цель игры «мирных космонавтов» — выполнить все задания, и при этом вычислить предателя. Если появляются подозрения, — их можно обсудить на общем голосовании.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129219494953000)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Among Us\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079871429408980992/gif006.gif\"}',15,0),(3,'UNO','{\"title\": \"Доброго времени суток, мы запустили ивент - UNO! Присоединяйся!\",\"description\": \"Настольная игра UNO - классическая игра, в которой нужно использовать карты действий против своих соперников по игре. Цель игры состоит в том, чтобы первым избавиться от всех своих карт в каждом раунде и набрать очки за карты, которые остались на руках у других игроков. Очки за каждый раунд складываются и игрок, набравший первым 500 очков, выигрывает. Каждый игрок вытягивает по одной карте из колоды. Игрок, у которого на руках самая старшая карта, будет сдающим. Главное - не забыть, когда останется одна карта, выкрикнуть UNO! \\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080128499731419198)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"UNO\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079870695959433356/gif005.gif\"}',10,2),(4,'Monopoly','{\"title\": \"Доброго времени суток, мы запустили ивент - Monopoly! Присоединяйся!\",\"description\": \"В классическом варианте необходимо наличие 2-6 игроков: каждый должен обладать собственной фишкой. Правила игры Монополия следует подробно изучить перед началом: посмотреть значения различных квадратов, по которым участники передвигаются в зависимости от значения числа, выпавшего на кубике. Экономическая настольная игра завязана на выгодной купле и продаже недвижимости, в которую вкладываются имеющиеся у участников средства. Вначале каждому дается одинаковая сумма, поэтому первое время возможности у всех равны. Деньги для игры в Монополию служат не только для купли-продажи недвижимости, но и для выплаты налогов или аренды в случае, если игрок попал на территорию конкурента. Но, хоть от действий игрока зависит многое, удача сильно влияет на дальнейший ход событий: бросок кубика во многом определяет, обогатится ли он или потерпит фиаско. Поле игры Монополия представляет собой ячейки, на которых расположена различная собственность с указанной стоимостью, секторы «Шанс», «Тюрьма» и другие.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129426425135195)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Monopoly\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079863810854240427/gif003.gif\"}',20,0),(5,'Дурак','{\"title\": \"Доброго времени суток, мы запустили ивент - Дурак! Присоединяйся!\",\"description\": \"Цель игры – раньше иных участников избавиться (сбросить с рук) от собственных карт. Тот игрок, единственный, у которого они остались, признается «дураком». Отбитые карты перенаправляются в отбой (биту) и уже не берут участие в игре до сдачи новой партии. Одна партия в игру «Дурак» именуется «кон».\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129322955841628)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Дурак\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079873321245626438/gif009.gif\"}',10,2),(6,'Правда или дейстивие','{\"title\": \"Доброго времени суток, мы запустили ивент - Правда или действие! Присоединяйся!\",\"description\": \"Правда или действие - социальная игра, которая проверяет смелость своих игроков. Вы либо отвечаете на неловкие вопросы, которые обязательно заставят вас покраснеть, либо выполняете нелепые задания, из-за которых вы будете выглядеть нелепо!\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080130083412529252)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Правда или действие\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079876226505789530/gif014.gif\"}',30,1),(7,'Бункер','{\"title\": \"Доброго времени суток, мы запустили ивент - Бункер! Присоединяйся!\",\"description\": \"Одна из особенностей игры «Бункер» – огромное разнообразие: играть в неё могут до 16 человек, и каждому достанется один из более 500 возможных персонажей с уникальными чертами характера, привычками и особенностями. Именно эти уникальные черты помогут персонажам попасть в спасительный бункер… или обрекут на смерть.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080130145798598706)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Бункер\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://cdn.discordapp.com/attachments/738118586677330013/1079883178044571678/gif015.gif\"}',35,0),(8,'GarticPhone','{\"title\": \"Доброго времени суток, мы запустили ивент - GarticPhone! Присоединяйся!\",\"description\": \"GarticPhone - представляет собой развлекательную онлайн-версию классической настольной игры. Его цель в онлайн игра через виртуальные комнаты где встречаются игроки, и по очереди каждый член комнаты должен нарисовать слово, назначенное игрой. Каждый игрок выбирается случайным образом, чтобы представлять то, что показывает игра. Игра может назначает вам от фрукта до целого памятника, даже человеческих чувств или эмоций. Другие участники должны угадать, что они видят нарисованным, и написать это в соответствующем текстовом поле для ответов. Все это делается в определенное время, в котором игроки могут написать столько слов, сколько сочтут нужным, пока не найдут правильный ответ.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080130026990739477)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"GarticPhone\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079869655193227304/gif004.gif\"}',15,4),(9,'Крокодил','{\"title\": \"Доброго времени суток, мы запустили ивент - Крокодил! Присоединяйся!\",\"description\": \"Игра «Крокодил» универсальна, в загадывается слово или словосочетание. Один игрок должен показать загаданное без подсказок и предметов, используя только своё остроумие и смекалку. Участник может пользоваться только мимикой, позами, жестами. Тот, кто отгадает задуманную фразу, становится на его место. Для большей вовлеченности в игру можно назначить приз человеку, который окажется наиболее догадливым, проявив смекалку.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129958107676712)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Крокодил\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://cdn.discordapp.com/attachments/738118586677330013/1079874599371681852/gif011.gif\"}',25,0),(10,'Kahoot','{\"title\": \"Доброго времени суток, мы запустили ивент - Kahoot! Присоединяйся!\",\"description\": \"Kahoot - это образовательная игра, основанная на викторинах, в которой игроки отвечают на вопросы с множественным выбором. Игра ведется онлайн, и каждый игрок использует свой собственный контроллер, чтобы отвечать на вопросы. Всю викторину можно настроить, выбрав из десятков типов вопросов. Вы можете выбирать из большой библиотеки готовых игр или создавать свои собственные. Вы даже можете загружать изображения, чтобы ответить на ваши вопросы!\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129660706377788)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Kahoot\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://cdn.discordapp.com/attachments/738118586677330013/1079875100918169700/gif012.gif\"}',25,0),(11,'CS:GO','{\"title\": \"Доброго времени суток, мы запустили ивент - CS:GO! Присоединяйся!\",\"description\": \"CS:GO - командный тактический шутер с видом от первого лица. Игра предлагает всем желающим сражения команд террористов и спецназовцев на множестве уникальных карт в разнообразных режимах, большое количество аутентичного огнестрельного оружия и улучшенную по сравнению с другими изданиями игры графику.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129896375922701)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"CS:GO\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079872654741356626/gif008.gif\"}',30,1),(12,'Valorant','{\"title\": \"Доброго времени суток, мы запустили ивент - Valorant! Присоединяйся!\",\"description\": \"VALORANT — тактический шутер, бои в котором проходят в формате 5 на 5. В игре есть режим закупки оружия и принцип, который определяет победителя — закладывание бомбы, ее обезвреживание или убийство всех противников. В которой точная стрельба сочетается с уникальными умениями агентов.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129502178455562)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Valorant\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079875640813166823/gif013.gif\"}',30,0),(13,'Мемодел','{\"title\": \"Доброго времени суток, мы запустили ивент - Мемодел! Присоединяйся!\",\"description\": \"Мемодел - уморительная игра для самых остроумных, в которой нет правильных ответов и ограничений! Все просто! В начале игры тебе будут выданы несколько картинок. Прояви чувство юмора и находчивость и придумай смешные подписи для них. Твоя подпись вступит в битву с подписью другого игрока. А остальные участники будут голосовать, кто же из вас лучший мемодел!\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129584630075422)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Мемодел\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079873887040438352/gif010.gif\"}',25,0),(14,'Dota 2','{\"title\": \"Доброго времени суток, мы запустили ивент - Dota 2! Присоединяйся!\",\"description\": \"Dota 2 является комбинацией RTS и RPG. Игроки делятся на две конкурирующие команды (силы Света и силы Тьмы), каждая из которых содержит до пяти игроков. Главной целью игры является уничтожение вражеского Древнего и защита своего. Древних защищают по три башни на каждой стороне. Каждый игрок управляет героем, стратегически мощной единицей с уникальными способностями и характеристиками, улучшаемыми со временем. Герой может получать опыт для повышения своего уровня, зарабатывать золото, покупать и собирать предметы, которые усиливают его. Каждый игрок постоянно получает небольшое количество золота, а также зарабатывает его убийством крипов, героев и разрушением строений. В Dota 2 сделан сильный упор на тактику и командную работу, а стратегия зачастую завязана на скоростном наборе мощности, оптимальном выборе предметов и порядке улучшения способностей.\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129830739251210)\\n \\n**Награды:**\\n<:__:998250854610108517> **Победа** 150 <:co1n:995803456394764418>\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Dota 2\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/738118586677330013/1079872027562868799/gif007.gif\"}',30,1),(15,'Cinema','{\"title\": \"Доброго времени суток, мы запустили ивент - Кинотеатр! Присоединяйся!\",\"description\": \"Кинотеатр - это совместный просмотр абсолютно всех фильмов которые вы пожелаете!Почувствуй себя в уютной компании с друзьями при совместном просмотре фильмов!\\n\\n• **Время проведения:** {time_start}\\n\\n• **Ведущий:** {eventer}\\n\\n[Подробнее об ивенте](https://discord.com/channels/468502950084345888/1080082023705751632/1080129752754556928)\\n \\n**Награды:**\\n<:__:998250854610108517> **Участие** 50 <:co1n:995803456394764418>\",\"author\": {\"name\": \"Кинотеатр\",\"icon_url\": \"https://cdn-icons-png.flaticon.com/128/2157/2157114.png\"},\"color\": 0,\"image\": \"https://media.discordapp.net/attachments/1049039022401531947/1079862222471303168/gif002.gif\"}',15,4);
